import React from "react";
import TextField from '@material-ui/core/TextField';

const Form = () => {
    return(
        <>
            <div className = "center_div">
                <h2>Create Account</h2>
                <TextField id="standard-basic" label="Enter Your Name" /><br/><br/>
                <TextField id="standard-basic" label="Enter Your Name" /><br/><br/>
                <TextField id="standard-basic" label="Enter Your Name" /><br/><br/>
                <TextField id="standard-basic" label="Enter Your Name" /><br/><br/>
                
            </div>
        </>
    )
}

export default Form;
